import React, { memo } from "react";


function MomoDiv({memoList}){
    var returnMemo =[]
    var i=0;
    console.log(memoList);
    while(i<memoList.memoList){
        returnMemo.push(<div className="memoElement" key={memoList[i]}>{memoList[i]}</div>)
    }
    return (
        returnMemo
    );
}


export default MomoDiv;
